(1, 'AllProjects', 'Arduino', 'BraÃ§o RobÃ³tico', '2020-01-09', '/*\r\n   Curso de Arduino e AVR WR Kits Channel\r\n   \r\n   Aula 103 - Controle de Servos por WiFi Com ESP8266\r\n\r\n   Autor: Eng. Wagner Rambo  Data: Janeiro de 2017\r\n   \r\n   www.wrkits.com.br | facebook.com/wrkits | youtube.com/user/canalwrkits\r\n   \r\n*/\r\n\r\n// =============================================================================================================\r\n// --- Bibliotecas ---\r\n#include <SoftwareSerial.h>    //inclui biblioteca software serial\r\n#include <Servo.h>             //inclui biblioteca para controle dos servos\r\n\r\n\r\n// =============================================================================================================\r\n// --- Objetos ---\r\nSoftwareSerial esp8266(5, 4);  //pino TX do ESP8266 ligado no digital 5 e RX no digital 4  \r\nServo sv1;                     //servo motor 1\r\nServo sv2;                     //servo motor 2\r\nServo sv3;                     //servo motor 3\r\nServo sv4;                     //servo motor 4\r\n\r\n \r\n// =============================================================================================================\r\n// --- Constantes e Mapeamento de Hardware ---\r\n#define DEBUG true               //DEBUG no serial monitor\r\n#define serv1 9                 //servo motor 1 \r\n#define serv2 10               //servo motor 2  \r\n#define serv3 11               //servo motor 3 \r\n#define serv4 12              //servo motor 4\r\n\r\n\r\n// =============================================================================================================\r\n// --- ProtÃ³tipo das FunÃ§Ãµes ---\r\nString sendData(String command, const int timeout, boolean debug);\r\n\r\n\r\n// =============================================================================================================\r\n// --- VariÃ¡veis Globais ---\r\nint   pos1     = 175,          //armazena posiÃ§Ã£o do servo 1\r\n      pos2     = 175,          //armazena posiÃ§Ã£o do servo 2\r\n      pos3     = 175,          //armazena posiÃ§Ã£o do servo 3\r\n      pos4     = 175,          //armazena posiÃ§Ã£o do servo 4\r\n      vel      =  10,          //velocidade dos servos (100 -> 90Âº in 1 s)(1 -> 90Âº in 9 s)\r\n      pos1min  =  15,          //posiÃ§Ã£o mÃ­nima do servo 1\r\n      pos2min  =  15,          //posiÃ§Ã£o mÃ­nima do servo 2\r\n      pos3min  =  15,          //posiÃ§Ã£o mÃ­nima do servo 3\r\n      pos4min  =  15,          //posiÃ§Ã£o mÃ­nima do servo 4\r\n      pos1max  = 160,          //posiÃ§Ã£o mÃ¡xima do servo 1\r\n      pos2max  = 160,         //posiÃ§Ã£o mÃ¡xima do servo 2\r\n      pos3max  = 160,          //posiÃ§Ã£o mÃ¡xima do servo 3\r\n      pos4max  = 160;          //posiÃ§Ã£o mÃ¡xima do servo 4\r\n \r\n \r\n// =============================================================================================================\r\n// --- ConfiguraÃ§Ãµes Iniciais ---\r\nvoid setup()\r\n{\r\n \r\n  // -- Configura Servos e PosiÃ§Ãµes Iniciais --\r\n  sv1.attach(serv1);\r\n  sv2.attach(serv2);\r\n  sv3.attach(serv3);\r\n  sv4.attach(serv4);\r\n  sv1.write(pos1max);\r\n  sv2.write(pos2max);\r\n  sv3.write(pos3max);\r\n  sv4.write(pos4max);\r\n  sv1.detach();\r\n  sv2.detach();\r\n  sv3.detach();\r\n  sv4.detach();\r\n \r\n  // -- Inicia ComunicaÃ§Ã£o Serial --\r\n  Serial.begin(9600);\r\n  esp8266.begin(19200);\r\n\r\n  // -- Configura WiFi --\r\n  // ============================\r\n  sendData(\"AT+RST\\r\\n\", 2000, DEBUG);                                   //reset no modulo\r\n  sendData(\"AT+CWMODE=1\\r\\n\", 1000, DEBUG);                              //modo station\r\n  sendData(\"AT+CWJAP=\\\"Dj\\\",\\\"abcdefghi\\\"\\r\\n\", 2000, DEBUG);   //conecta com rede Wifi (nome e senha)\r\n  while(!esp8266.find(\"OK\"));                                            //aguarda atÃ© que haja conexÃ£o\r\n  \r\n  sendData(\"AT+CIFSR\\r\\n\", 1000, DEBUG);                                 //mostra endereÃ§o IP\r\n  sendData(\"AT+CIPMUX=1\\r\\n\", 1000, DEBUG);                              //permite mÃºltiplas conexÃµes\r\n  sendData(\"AT+CIPSERVER=1,80\\r\\n\", 1000, DEBUG);                        //inicia web server na porta 80\r\n  \r\n} //end setup\r\n \r\n\r\n// =============================================================================================================\r\n// --- Loop Infinito ---\r\nvoid loop()\r\n{\r\n  \r\n  if (esp8266.available())  //verifica se existem dados disponÃ­veis no ESP8266\r\n  {\r\n    if (esp8266.find(\"+IPD,\")) //novo comando?\r\n    {                          //Sim\r\n      String msg;\r\n      esp8266.find(\"?\");                    //movimenta cursor atÃ© encontrar conteÃºdo da mensagem\r\n      msg = esp8266.readStringUntil(\' \');   //lÃª mensagem\r\n      String command = msg.substring(0, 3); //\"sr1\" = comando para o servo #1 e \"sr2\" = comando para o servo #2\r\n      String valueStr = msg.substring(4);   //os 3 caracteres seguintes informam o Ã¢ngulo desejado\r\n      int value = valueStr.toInt();\r\n      if (DEBUG) {\r\n        Serial.println(command);\r\n        Serial.println(value);\r\n      }\r\n      delay(100);\r\n \r\n      //-- controle do servo 1 --\r\n      if(command == \"sr1\") \r\n      {\r\n        //limita Ã¢ngulo do servo\r\n        if (value >= pos1max) value = pos1max;      \r\n        \r\n        if (value <= pos1min) value = pos1min;\r\n          \r\n    \r\n        sv1.attach(serv1); //conecta servo1\r\n        while(pos1 != value) \r\n        {\r\n          if (pos1 > value) \r\n          {\r\n            pos1 -= 1;\r\n            sv1.write(pos1);\r\n            delay(100/vel);\r\n          }\r\n          if (pos1 < value) \r\n          {\r\n            pos1 += 1;\r\n            sv1.write(pos1);\r\n            delay(100/vel);\r\n          }\r\n        } //end while\r\n        sv1.detach(); //desconecta servo1\r\n      \r\n      } //end controle servo1\r\n\r\n \r\n      //-- controle do servo 2 --\r\n      if(command == \"sr2\") \r\n      {\r\n        //limita Ã¢ngulo do servo\r\n        if (value >= pos2max) value = pos2max;\r\n  \r\n        if (value <= pos2min) value = pos2min;\r\n\r\n         \r\n        sv2.attach(serv2); //conecta servo2\r\n        while(pos2 != value) \r\n        {\r\n          if (pos2 > value) \r\n          {\r\n            pos2 -= 1;\r\n            sv2.write(pos2);\r\n            delay(100/vel);\r\n          }\r\n          if (pos2 < value) \r\n          {\r\n            pos2 += 1;\r\n            sv2.write(pos2);\r\n            delay(100/vel);\r\n          }\r\n        } //end while   \r\n        sv2.detach(); //desconecta servo 2 \r\n            \r\n      } //end controle servo 2\r\n\r\n\r\n      //-- controle do servo 3 --\r\n      if(command == \"sr3\") \r\n      {\r\n        //limita Ã¢ngulo do servo\r\n        if (value >= pos3max) value = pos3max;\r\n  \r\n        if (value <= pos3min) value = pos3min;\r\n\r\n         \r\n        sv3.attach(serv3); //conecta servo3\r\n        while(pos3 != value) \r\n        {\r\n          if (pos3 > value) \r\n          {\r\n            pos3 -= 1;\r\n            sv3.write(pos3);\r\n            delay(100/vel);\r\n          }\r\n          if (pos3 < value) \r\n          {\r\n            pos3 += 1;\r\n            sv3.write(pos3);\r\n            delay(100/vel);\r\n          }\r\n        } //end while   \r\n        sv3.detach(); //desconecta servo 3 \r\n            \r\n      } //end controle servo 3\r\n\r\n      //-- controle do servo 4 --\r\n      if(command == \"sr4\") \r\n      {\r\n        //limita Ã¢ngulo do servo\r\n        if (value >= pos4max) value = pos4max;\r\n  \r\n        if (value <= pos4min) value = pos4min;\r\n\r\n         \r\n        sv4.attach(serv4); //conecta servo4\r\n        while(pos4 != value) \r\n        {\r\n          if (pos4 > value) \r\n          {\r\n            pos4 -= 1;\r\n            sv4.write(pos4);\r\n            delay(100/vel);\r\n          }\r\n          if (pos4 < value) \r\n          {\r\n            pos4 += 1;\r\n            sv4.write(pos4);\r\n            delay(100/vel);\r\n          }\r\n        } //end while   \r\n        sv4.detach(); //desconecta servo 4 \r\n            \r\n      } //end controle servo 4     \r\n    }\r\n  }\r\n  \r\n} //end loop\r\n      \r\n \r\n \r\n// =============================================================================================================\r\n// --- FunÃ§Ã£o ---\r\nString sendData(String command, const int timeout, boolean debug)\r\n{\r\n  String response = \"\";\r\n  esp8266.print(command);\r\n  long int time = millis();\r\n  while ( (time + timeout) > millis())\r\n  {\r\n    while (esp8266.available())\r\n    {\r\n      char c = esp8266.read();\r\n      response += c;\r\n    }\r\n  }\r\n  if (debug)\r\n  {\r\n    Serial.print(response);\r\n  }\r\n  return response;\r\n\r\n} //end sendData\r\n\r\n\r\n\r\n', 'Cuidado com a energia aplicada aos servos;\r\nFonte de 5V;\r\nUtilize os parafusos adequados para montar a garra e tente deixar o mais organizado possÃ­vel.', );
