(11, 'Jairobudokai', 'Python', 'BDTK4', '2020-01-09', 'def Soma1aN(N):\r\nif N==1: return(1)\r\nelse: return (N+Soma1aN(N-1)) # note-se a ativaÃ§Ã£o recursiva\r\n\r\n# Uso da funÃ§Ã£o\r\nN=int(input(\'Entre com o valor de N: \'))\r\nprint(\'A soma de 1 a\', N, \'Ã©\', Soma1aN(N))\r\n\r\nResultados da execuÃ§Ã£o:\r\n\r\nEntre com o valor de N: 5\r\nA soma de 1 a 5 Ã© 15\r\n\r\nEntre com o valor de N: 10\r\nA soma de 1 a 10 Ã© 55', 'Novo projeto de game para vocÃªs!', );
INSERT INTO `projeto` (`Cod_projeto`, `Usuario`, `Linguagem`, `Nome`, `Data`, `Programa`, `Detalhes`, `Imagem`) VALUES
(12, 'Fernando dos Santos', 'Python', 'Fibonacci', '2020-01-09', '\"\"\" FIBONACCI USANDO A FUNÃ‡ÃƒO RECURSIVA FibRec \"\"\"\r\n\r\n\"\"\" Gera os primeiros N nÃºmeros da sequÃªncia de Fibonacci\r\n    e calcula a razÃ£o entre cada 2 consecutivos.\r\n    A partir do 26Âº haverÃ¡ problema de alinhamento vertical\r\n    dos resultados.\"\"\"\r\n\r\n\"\"\"Esta funÃ§Ã£o calcula o n-Ã©simo elemento da sequÃªncia de Fibonacci\r\n   a partir da definiÃ§Ã£o indutiva: F(1)=1, F(2)=1, F(N)=F(N-1)+F(N-2)\r\n   (a partir do 3o., cada elemento Ã© a soma dos dois anteriores) \"\"\"\r\n   import math # Ativa o mÃ³dulo de funÃ§Ãµes matemÃ¡ticas\r\n   def FibRec(N): # DÃ¡ o valor do N-Ã©simo elemento do sequÃªncia\r\n   if N==1: return(1)\r\n       if N==2: return(1)\r\n     else: return (FibRec(N-1)+FibRec(N-2))\r\n\r\n# Programa que usa a funÃ§Ã£o FibRec para gerar a sequÃªncia\r\n# O limite deve ser maior ou igual a 2\r\nLimite=int(input(\'Entre com o nÃºmero de elementos (>=2): \'))\r\nN=2 # NÃºmero de cada elemento da sequÃªncia\r\n# Imprime os tÃ­tulos da tabela\r\nprint(\' N   Fib(N)   RazÃ£o\')\r\nprint(\' \', \'1\', 3*\' \', \'1\')\r\nprint(\' \', \'2\', 3*\' \', \'1\',3*\' \', \'1.0\')\r\nFibA = 1\r\nFibB = 1\r\nwhile N < Limite:\r\n     FibA=FibRec(N)\r\n     N=N+1\r\n     FibB=FibRec(N)\r\n     \"\"\" Concatena 3 brancos Ã  esquerda se Fib(N) for menor do que 10,\r\n         2 se for maior do que 9 e menor do que 100,\r\n         1 se for maior do que 99 e menor do que 1000.\r\n         Se for maior do que 1000 haverÃ¡ problema de alinhamento \"\"\"\r\n     print(2*\' \'+str(N) if N<10 else \' \'+str(N) if N<100 else N,\r\n      4*\' \'+str(FibB) if FibB<10 else\r\n      3*\' \'+str(FibB) if FibB<100 else\r\n      2*\' \'+str(FibB) if FibB<1000 else\r\n      \' \'+str(FibB) if FibB<10000 else FibB, 3*\' \', FibB/FibA)\r\nprint(\'Compare com a razÃ£o Ã¡urea:\\n\', 12*\' \',(1+math.sqrt(5))/2)\r\n\r\nResultado (o nÃºmero de espaÃ§os em branco serÃ¡ diferente):\r\n\r\nEntre com o nÃºmero de elementos (>=2): 20\r\nN Fib(N)     RazÃ£o\r\n1     1\r\n2     1 1.0\r\n3     2 2.0\r\n4     3 1.5\r\n5     5 1.6666666666666667\r\n6     8 1.6\r\n7    13 1.625\r\n8    21 1.6153846153846154\r\n9    34 1.619047619047619\r\n10   55 1.6176470588235294\r\n11   89 1.6181818181818182\r\n12  144 1.6179775280898876\r\n13  233 1.6180555555555556\r\n14  377 1.6180257510729614\r\n15  610 1.6180371352785146\r\n16  987 1.618032786885246\r\n17 1597 1.618034447821682\r\n18 2584 1.6180338134001253\r\n19 4181 1.618034055727554\r\n20 6765 1.6180339631667064\r\nCompare com a razÃ£o Ã¡urea:\r\n        1.618033988749895', 'SequÃªncia de fibonacci feita em python.', );
