(13, 'Fernando dos Santos', 'Java', 'Hello World', '2020-01-09', '\r\n/*\r\n * O primeiro programa em Java: Hello World\r\n * Autor: Jacques SauvÃ©\r\n */\r\n\r\n// Todo programa tem um ponto de entrada: o \"mÃ©todo\" main de alguma \"classe\"\r\npublic class Hello {\r\n  public static void main(String[] args) {\r\n    System.out.println(\"Hello, world!\");\r\n  }\r\n}', 'Um programa simples mostrando o bÃ¡sico da linguagem conhecida como Java.', ),
(14, 'Carlos Eduardo', 'Java', 'Leitura de nÃºmeros', '2020-01-09', 'package p2.exemplos;\r\n\r\nimport java.util.Scanner;\r\n\r\n/*\r\n * \"Ler 3 nÃºmeros inteiros da entrada, imprimir o menor e o maior\"\r\n *\r\n */\r\n\r\npublic class MinMax1 {\r\n    public static void main(String[] args) {\r\n        Scanner sc = new Scanner(System.in);\r\n        int n1, n2, n3;\r\n\r\n        System.out.print(\"Entre com o primeiro inteiro: \");\r\n        n1 = sc.nextInt();\r\n        System.out.print(\"Entre com o segundo inteiro: \");\r\n        n2 = sc.nextInt();\r\n        System.out.print(\"Entre com o terceiro inteiro: \");\r\n        n3 = sc.nextInt();\r\n        if (n1 > n2) {\r\n            if (n1 > n3) {\r\n                if (n2 < n3) {\r\n                    System.out.println(\"O menor numero eh: \" + n2);\r\n                } else {\r\n                    System.out.println(\"O menor numero eh: \" + n3);\r\n                }\r\n                System.out.println(\"O maior numero eh: \" + n1);\r\n            } else {\r\n                if (n1 < n2) {\r\n                    System.out.println(\"O menor numero eh: \" + n1);\r\n                } else {\r\n                    System.out.println(\"O menor numero eh: \" + n2);\r\n                }\r\n                System.out.println(\"O maior numero eh: \" + n3);\r\n            }\r\n        } else {\r\n            if (n2 > n3) {\r\n                if (n1 < n3) {\r\n                    System.out.println(\"O menor numero eh: \" + n1);\r\n                } else {\r\n                    System.out.println(\"O menor numero eh: \" + n3);\r\n                }\r\n                System.out.println(\"O maior numero eh: \" + n2);\r\n            } else {\r\n                if (n1 < n2) {\r\n                    System.out.println(\"O menor numero eh: \" + n1);\r\n                } else {\r\n                    System.out.println(\"O menor numero eh: \" + n2);\r\n                }\r\n                System.out.println(\"O maior numero eh: \" + n3);\r\n            }\r\n        }\r\n    }\r\n}', 'Ler 3 nÃºmeros inteiros da entrada, imprimir o menor e o maior.', );
