(15, 'Carlos Eduardo', 'Arduino', 'Led on/off', '2020-01-09', '// a funÃ§Ã£o de configuraÃ§Ã£o Ã© executada uma vez que vocÃª pressiona a tecla de reinicializaÃ§Ã£o ou liga a placa\r\nvoid setup() {\r\n  // inicializa o pino digital LED_BUILTIN como saÃ­da.\r\n  pinMode(LED_BUILTIN, OUTPUT);\r\n}\r\n// a funÃ§Ã£o de loop funciona uma e outra vez para sempre\r\nvoid loop() {\r\n  digitalWrite(LED_BUILTIN, HIGH); // liga o LED (ALTO Ã© o nÃ­vel de tensÃ£o)\r\n  delay(1000); // aguarde um segundo\r\n  digitalWrite(LED_BUILTIN, LOW); // desligue o LED fazendo a tensÃ£o BAIXO\r\n  delay(1000); // aguarde um segundo\r\n}\r\n\r\n ', 'a funÃ§Ã£o de configuraÃ§Ã£o Ã© executada uma vez que vocÃª pressiona a tecla de reinicializaÃ§Ã£o ou liga a placa.', );
