(16, 'Jairobudokai', 'Arduino', 'CONECTANDO UM BOTÃƒO', '2020-01-09', '// constants won\'t change. They\'re used here to set pin numbers\r\nconst int buttonPin = 2; // the number of the pushbutton pin\r\nconst int ledPin = 13; // the number of the LED pin\r\n \r\n// variables will change:\r\nint buttonState = 0; // variable for reading the pushbutton status\r\n \r\nvoid setup() {\r\n// initialize the LED pin as an output:\r\npinMode(ledPin, OUTPUT);\r\n// initialize the pushbutton pin as an input:\r\n   pinMode(buttonPin, INPUT);\r\n}\r\n \r\nvoid loop() {\r\n// read the state of the pushbutton value:\r\n   buttonState = digitalRead(buttonPin);\r\n \r\n// check if the pushbutton is pressed. If it is, the buttonState is HIGH:\r\nif (buttonState == HIGH) {\r\n// turn LED on:\r\n   digitalWrite(ledPin, HIGH);\r\n} else {\r\n// turn LED off:\r\n   digitalWrite(ledPin, LOW);\r\n}\r\n}\r\n', 'CONECTANDO UM BOTÃƒO PUSH (PUSHBUTTON) PARA O MICROCONTROLADOR.', );
INSERT INTO `projeto` (`Cod_projeto`, `Usuario`, `Linguagem`, `Nome`, `Data`, `Programa`, `Detalhes`, `Imagem`) VALUES
(17, 'Jairobudokai', 'Arduino', 'Arduino exemplo', '2020-01-09', 'int led = 9; // the PWM pin the LED is attached to\r\nint brightness = 0; // how bright the LED is\r\nint fadeAmount = 5; // how many points to fade the LED by\r\n \r\n// the setup routine runs once when you press reset:\r\nvoid setup() {\r\n// declare pin 9 to be an output:\r\n   pinMode(led, OUTPUT);\r\n}\r\n \r\n// the loop routine runs over and over again forever:\r\nvoid loop() {\r\n// set the brightness of pin 9:\r\n   analogWrite(led, brightness);\r\n \r\n// change the brightness for next time through the loop:\r\n   brightness = brightness + fadeAmount;\r\n \r\n// reverse the direction of the fading at the ends of the fade:\r\n   if(brightness <= 0 || brightness >= 255) {\r\n   fadeAmount = -fadeAmount;\r\n}\r\n// wait for 30 milliseconds to see the dimming effect\r\n   delay(30);\r\n}\r\n\r\n   ', ' O cÃ³digo de exemplo para esta prÃ¡tica pode ser encontrado em Arquivo-> Exemplos-> 01.Basics-> Fade. A principal idÃ©ia Ã© aumentar e diminuir a intensidade luminosa do LED usando o PWM (Modulador de largura de pulso). O cÃ³digo neste exemplo Ã©', );
